# OEIS sequence: A242965

from sympy import divisors, isprime
for n in range(3, 10**4):
    for d in [2*d for d in divisors(n) if n > 2*d and n % (2*d)] + \
             [d for d in divisors(2*n-1) if n > d >= 2 and n % d] + \
             [d for d in divisors(2*n+1) if n > d >= 2 and n % d]:
        if not isprime(d):
            break
    else:
        print(n, end=', ')
